import React from 'react';

const Contact = ()=>{
    return(
        <>
          <div className="container">
              <div className="form">
                  <div className="form-group">
                      <label htmlFor="full_name"></label>
                  </div>
              </div>
          </div>
        </>
    );
}

export default Contact;
